td {
    overflow: hidden;
    position: relative;
    width: 254px;
    max-width: 254px;
    white-space: nowrap;
    text-overflow: ellipsis;
    height: 22px;
    padding:10px 5px;
    border-bottom:1px solid #ddd;
}
td label {
    width: 100%;
    height: 100%;
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
}
td input {
    position: relative;
    top: 1px;
}
td button {
    position: absolute;
    z-index: 1;
    display: none;
}
td .remove {
    top: 9px;
    right: 2px;
    display: none;
}
td .edit {
    top: 9px;
    right: 45px;
    display: none;
}
td:hover .edit,
td:hover .remove {
    display: block;
}

.btn{
    margin-right:10px;
    font-size:12px;
    border-radius: 3px;
}
